pragma solidity >=0.5.16 <0.9.0;
import './Artist.sol';
contract ArtistFactory {
    // mapping (address => uint) public ownerToArtist;
    Artist [] public artists;
    uint public idCounter;

    constructor() public {
        idCounter = 0;
    }

    function createArtist(string memory _name) public {
        Artist a = new Artist(msg.sender, idCounter, _name);
        // artistIDs[msg.sender] = idCounter;
        artists.push(a);
        idCounter += 1;
    }

    // We will use this function to search for artists in the browser
    function getAllArtists() public view returns(Artist[] memory) {
        return artists;
    }
}
